Name: Leah
Age: 18
Likes: horror movies, going out to eat, food, sushi, Italian, traveling, shopping, kittens, shooting, and sleeping! ; )
Dislikes: mean people, assholes, jealousy and ignorance ; )

Have fun in the site!!!
XoXo, Leah


